import React from "react";

function Video({ video, onUpVote, onDownVote, onRemove }) {
  return (
    <div>
      <h2>{video.title}</h2>
      <iframe
        width="560"
        height="315"
        src={video.url}
        title={video.title}
        frameBorder="0"
        allowFullScreen
      ></iframe>
      <p>Votes: {video.rating}</p>
      <button onClick={() => onUpVote(video.id)}>Up Vote</button>
      <button onClick={() => onDownVote(video.id)}>Down Vote</button>
      <button onClick={() => onRemove(video.id)}>Remove</button>
    </div>
  );
}

export default Video;
